import { useLocation } from "react-router-dom"
import { useState, useEffect } from "react"
import Post from "./post"
import axios from "axios"
export default function Profile(){
    const location = useLocation()
    const user = {username :localStorage.getItem("username") , email:localStorage.getItem("email")}
    const [posts, setPosts] = useState([])
    function getPosts() {
        axios(
            {
                method: "get",
                url: "/api/posts/"
            }
        ).then(response => setPosts(response.data))
    }
    const x = posts.filter(post => post.author == user.pk)
    const elements = x.map(post => <Post pb={post.publicationDate} pk={post.pk} title={post.title} authorpk={post.author} author={user.username} text={post.text} />)
    useEffect(getPosts, [location.state.pk])

    return (
        <div className="profile">
            <h1>{user.username}</h1>
            <h2>{user.email}</h2>
            <div className="content">
                {elements}
            </div>
        </div>
    )
}
